import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MyHeader from './MyHeader.jsx';
import Home from './Home.jsx'; // Create this component
import About from './About.jsx'; // Create this component
import Activities from './ActivitiesSection.jsx'; // Assuming this is your activities section
import Team from './Team.jsx'; // Create this component
import ConuAI from './ConuAI.jsx'; // Create this component

function App() {
    return (
        <Router>
            <MyHeader />
            <Switch>
                <Route path="/" exact component={Home} />
                <Route path="/about" component={About} />
                <Route path="/activities" component={Activities} />
                <Route path="/team" component={Team} />
                <Route path="/conuai" component={ConuAI} />
            </Switch>
        </Router>
    );
}

export default App;
